import React from "react";
import logo from "./logo.svg";
import { Col, Row, Button, Checkbox, Form, Input } from "antd";
import { LoginOutlined } from "@ant-design/icons";

import "./App.css";
import "./Responsive.css";

const onFinish = (values: any) => {
  console.log("Success:", values);
};

const onFinishFailed = (errorInfo: any) => {
  console.log("Failed:", errorInfo);
};

function App() {
  return (
    <div className="App">
      <Row style={{ height: "100%" }}>
        <Col span={12} xs={24} sm={12}>
          <div className="register register-left">
            <div className="register-left-title">
              <img
                src="https://cdn.haitrieu.com/wp-content/uploads/2022/06/Logo-Thanh-Pho-Da-Nang.png"
                alt="logo DA NANG city"
              />
              <h2>KHO KẾT QUẢ THỦ TỤC HÀNH CHÍNH SỐ</h2>
            </div>

            <Form
              name="basic"
              labelCol={{ span: 24 }}
              wrapperCol={{ span: 0 }}
              style={{ maxWidth: 600 }}
              initialValues={{ remember: true }}
              onFinish={onFinish}
              onFinishFailed={onFinishFailed}
              autoComplete="off"
            >
              <Form.Item
                label="Tên đăng nhập"
                name="username"
                rules={[
                  { required: true, message: "Vui lòng nhập tên đăng nhập!" },
                ]}
              >
                <Input />
              </Form.Item>

              <Form.Item
                label="Mật khẩu"
                name="password"
                rules={[{ required: true, message: "Vui lòng nhập mật khẩu!" }]}
              >
                <Input.Password />
              </Form.Item>

              <Form.Item
                name="remember"
                valuePropName="checked"
                wrapperCol={{ offset: 0, span: 11 }}
              >
                <Checkbox>Remember me</Checkbox>
              </Form.Item>

              <Form.Item wrapperCol={{ offset: 0, span: 0 }}>
                <Button
                  type="primary"
                  htmlType="submit"
                  style={{ width: "100%" }}
                >
                  <LoginOutlined />
                  Đăng nhập
                </Button>
              </Form.Item>
              <Form.Item wrapperCol={{ offset: 0, span: 0 }}>
                <Button
                  htmlType="submit"
                  style={{
                    width: "100%",
                    backgroundColor: "#ff8f18",
                  }}
                  type="primary"
                >
                  Đăng nhập bằng tài khoản công dân số
                </Button>
              </Form.Item>
            </Form>
          </div>
        </Col>
        <Col span={12} xs={24} sm={12} className="col-right">
          <div className="register register-right"></div>
        </Col>
      </Row>
    </div>
  );
}

export default App;
